INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (3001, 2.1, "2030/01/01 14:59:59", -416.5, 130011, 3001100, "2024/10/31 12:00:00", 1, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 100, 0.0, "ヤマト", 2);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (3001, 5.68, "2030/01/01 14:59:59", -416.5, 130011, 3001101, "2024/10/31 12:00:00", 4, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 101, 0.0, "ヤマト", 2);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (3001, 0.0, "2030/01/01 14:59:59", -416.5, 130011, 3001102, "2024/10/31 12:00:00", 1, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 102, 0.0, "ヤマト", 1);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (3002, 0.0, "2030/01/01 14:59:59", -416.5, 130211, 3002100, "2024/10/31 12:00:00", 1, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 100, 0.0, "フブキ", 1);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (3002, 0.0, "2030/01/01 14:59:59", -416.5, 130211, 3002101, "2024/10/31 12:00:00", 1, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 101, 0.0, "フブキ", 1);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (3002, 8.53, "2030/01/01 14:59:59", -416.5, 130211, 3002102, "2024/10/31 12:00:00", 5, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 102, 0.0, "フブキ", 2);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (3002, 5.67, "2030/01/01 14:59:59", -416.5, 130211, 3002103, "2024/10/31 12:00:00", 7, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 103, 0.0, "フブキ", 1);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (3002, 0.0, "2030/01/01 14:59:59", -416.5, 130211, 3002104, "2024/10/31 12:00:00", 1, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 104, 0.0, "フブキ", 1);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (3004, 0.0, "2030/01/01 14:59:59", -416.5, 130211, 3002300, "2024/10/31 12:00:00", 3, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 300, 0.0, "フブキ", 3);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (3005, 0.0, "2030/01/01 14:59:59", -416.5, 130211, 3002400, "2024/10/31 12:00:00", 7, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 301, 0.0, "フブキ", 7);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (3003, 4.4, "2030/01/01 14:59:59", -416.5, 130211, 3003200, "2024/10/31 12:00:00", 2, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 200, 0.0, "フブキ", 1);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (3003, 0.0, "2030/01/01 14:59:59", -416.5, 130211, 3003201, "2024/10/31 12:00:00", 7, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 201, 0.0, "フブキ", 7);
INSERT INTO `v1_0b463b0571df6359c808a55144f734fbdc318b9965ed09c87d824cfd000a164c` VALUES (3003, 5.6, "2030/01/01 14:59:59", -416.5, 130211, 3003202, "2024/10/31 12:00:00", 1, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 202, 0.0, "フブキ", 2);
